import React, { useState } from 'react';

import { Header1 } from './Elements/Header1';

import './App.css';
import { Header2 } from './Elements/Header2';

function App() {
  const [foreground, setForeground] = useState("#000000");
  const [background, setBackground] = useState("#ff99ff");


  return (
    <main className="absolute w-full h-screen flex flex-col">
      <Header1
        title="Chromagraph"
      />

      <section className={`flex-1 flex justify-between bg-[${background}]`}>
        <section className="basis-1/3">
          <Header2
            title="Current Colors"
          />
        </section>

        <section className="basis-2/3">
          <Header2
            title="Color Combos"
          />
        </section>
      </section>
    </main>
  );
}

export default App;
